import React, { useState } from 'react';

export function PresentationToolbar({
  editorState,
  onToolChange,
  onSave,
  onPresent,
  onUndo,
  onRedo,
  presentationTitle,
  onTitleChange,
  isSaving = false
}) {
  const [isEditingTitle, setIsEditingTitle] = useState(false);
  const [tempTitle, setTempTitle] = useState(presentationTitle);

  const handleTitleSave = () => {
    onTitleChange(tempTitle);
    setIsEditingTitle(false);
  };

  const handleTitleCancel = () => {
    setTempTitle(presentationTitle);
    setIsEditingTitle(false);
  };

  const tools = [
    { id: 'select', icon: '👆', label: 'Select' },
    { id: 'text', icon: 'T', label: 'Text' },
    { id: 'image', icon: '🖼️', label: 'Image' },
    { id: 'shape', icon: '⬜', label: 'Shape' },
    { id: 'draw', icon: '✏️', label: 'Draw' },
  ];

  return (
    <div className="bg-white border-b border-gray-200 px-4 py-3 flex items-center justify-between">
      {/* Left side - Title and basic tools */}
      <div className="flex items-center space-x-4">
        {/* Presentation Title */}
        <div className="flex items-center space-x-2">
          {isEditingTitle ? (
            <div className="flex items-center space-x-2">
              <input
                type="text"
                value={tempTitle}
                onChange={(e) => setTempTitle(e.target.value)}
                className="px-2 py-1 border border-blue-300 rounded text-lg font-medium focus:outline-none focus:ring-2 focus:ring-blue-500"
                autoFocus
                onKeyDown={(e) => {
                  if (e.key === 'Enter') handleTitleSave();
                  if (e.key === 'Escape') handleTitleCancel();
                }}
              />
              <button
                onClick={handleTitleSave}
                className="px-2 py-1 bg-green-500 text-white rounded text-sm hover:bg-green-600"
              >
                ✓
              </button>
              <button
                onClick={handleTitleCancel}
                className="px-2 py-1 bg-gray-500 text-white rounded text-sm hover:bg-gray-600"
              >
                ✕
              </button>
            </div>
          ) : (
            <button
              onClick={() => setIsEditingTitle(true)}
              className="text-lg font-medium text-gray-900 hover:text-blue-600 px-2 py-1 rounded hover:bg-gray-100"
            >
              {presentationTitle}
            </button>
          )}
        </div>

        {/* Divider */}
        <div className="w-px h-6 bg-gray-300"></div>

        {/* Tools */}
        <div className="flex items-center space-x-1">
          {tools.map((tool) => (
            <button
              key={tool.id}
              onClick={() => onToolChange(tool.id)}
              className={`px-3 py-2 rounded-lg text-sm font-medium transition-colors ${
                editorState.tool === tool.id
                  ? 'bg-blue-100 text-blue-700 border border-blue-300'
                  : 'text-gray-600 hover:bg-gray-100 hover:text-gray-900'
              }`}
              title={tool.label}
            >
              <span className="text-lg">{tool.icon}</span>
            </button>
          ))}
        </div>
      </div>

      {/* Right side - Actions */}
      <div className="flex items-center space-x-3">
        {/* Undo/Redo */}
        <div className="flex items-center space-x-1">
          <button
            onClick={onUndo}
            className="p-2 text-gray-600 hover:bg-gray-100 rounded-lg disabled:opacity-50"
            disabled={true} // TODO: Implement undo/redo state
            title="Undo"
          >
            ↩️
          </button>
          <button
            onClick={onRedo}
            className="p-2 text-gray-600 hover:bg-gray-100 rounded-lg disabled:opacity-50"
            disabled={true} // TODO: Implement undo/redo state
            title="Redo"
          >
            ↪️
          </button>
        </div>

        {/* Divider */}
        <div className="w-px h-6 bg-gray-300"></div>

        {/* Save Button */}
        <button
          onClick={onSave}
          disabled={isSaving}
          className={`px-4 py-2 rounded-lg font-medium transition-colors ${
            isSaving
              ? 'bg-gray-300 text-gray-500 cursor-not-allowed'
              : 'bg-blue-600 text-white hover:bg-blue-700'
          }`}
        >
          {isSaving ? (
            <div className="flex items-center space-x-2">
              <div className="w-4 h-4 border-2 border-white border-t-transparent rounded-full animate-spin"></div>
              <span>Saving...</span>
            </div>
          ) : (
            'Save'
          )}
        </button>

        {/* Present Button */}
        <button
          onClick={onPresent}
          className="px-4 py-2 bg-green-600 text-white rounded-lg font-medium hover:bg-green-700 transition-colors"
        >
          Present
        </button>
      </div>
    </div>
  );
}
